import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from "react-router-dom";

// Import feature components
import Users from "./users/Users";
import Communication from "./communication/Communication";
import DonationCoordination from "./donation_coordination/DonationCoordination";
import Notification from "./notification/Notification";
import DatabasePage from "./database/Database";
import Recipe from "./recipe/Recipe";
import WasteAnalyses from "./waste_analyses/WasteAnalyses";
import ExpiryManager from "./expiry_manager/ExpiryManager";
import LoginSignup from "./auth/LoginSignup";

// A wrapper for protected routes
function PrivateRoute({ isLoggedIn, children }) {
  return isLoggedIn ? children : <Navigate to="/login" />;
}

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => setIsLoggedIn(true);
  const handleLogout = () => setIsLoggedIn(false);

  return (
    <Router>
      <div>
        {isLoggedIn ? (
          <nav style={{ padding: 10, borderBottom: "1px solid #ddd" }}>
            <Link to="/">Main Menu</Link> |{" "}
            <Link to="/users">Users</Link> |{" "}
            <Link to="/communication">Communication</Link> |{" "}
            <Link to="/donations">Donations</Link> |{" "}
            <Link to="/notification">Notification</Link> |{" "}
            <Link to="/database">Database</Link> |{" "}
            <Link to="/recipes">Recipes</Link> |{" "}
            <Link to="/waste">Waste Analyses</Link> |{" "}
            <Link to="/expiry">Expiry Manager</Link> |{" "}
            <button onClick={handleLogout}>Logout</button>
          </nav>
        ) : null}

        <Routes>
          {/* Public route */}
          <Route path="/login" element={<LoginSignup onLogin={handleLogin} />} />

          {/* Private routes */}
          <Route
            path="/"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <h2>Main Menu (Placeholder)</h2>
              </PrivateRoute>
            }
          />
          <Route
            path="/users"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <Users />
              </PrivateRoute>
            }
          />
          <Route
            path="/communication"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <Communication />
              </PrivateRoute>
            }
          />
          <Route
            path="/donations"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <DonationCoordination />
              </PrivateRoute>
            }
          />
          <Route
            path="/notification"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <Notification />
              </PrivateRoute>
            }
          />
          <Route
            path="/database"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <DatabasePage />
              </PrivateRoute>
            }
          />
          <Route
            path="/recipes"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <Recipe />
              </PrivateRoute>
            }
          />
          <Route
            path="/waste"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <WasteAnalyses />
              </PrivateRoute>
            }
          />
          <Route
            path="/expiry"
            element={
              <PrivateRoute isLoggedIn={isLoggedIn}>
                <ExpiryManager />
              </PrivateRoute>
            }
          />

          {/* Default redirect */}
          <Route path="*" element={<Navigate to={isLoggedIn ? "/" : "/login"} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
